// src/App.js
import React from "react";
import "./App.css";
import Header from "./components/Header";

function App() {
  const jobs = [
    {
      title: "富士フィルムのオープンポジション",
      company: "富士フィルム株式会社",
      salary: "年収 400万円〜900万円",
      location: "東京都 港区",
      type: "正社員",
      features: ["完全週休二日制", "第二新卒歓迎", "産休・育休取得実績あり"],
    },
    {
      title: "オープンポジション",
      company: "ユニ・チャーム株式会社",
      salary: "年収 450万円〜650万円",
      location: "東京都 港区",
      type: "正社員",
      features: ["フレックスタイム制あり", "寮・社宅あり"],
    },
  ];

  return (

      <div className="App">
        {/* Header */}
        <header className="App-header">
          <h1>IT技術者連携 | SES</h1>
        </header>

        {/* Search Bar */}
        <div className="search-bar">
          <input type="text" placeholder="職種、キーワード、会社名" />
          <button>求人検索</button>
        </div>

        {/* Job Cards */}
        <div className="job-list">
          {jobs.map((job, index) => (
              <div className="job-card" key={index}>
                <h2>{job.title}</h2>
                <p>{job.company}</p>
                <p>{job.salary}</p>
                <p>{job.location}</p>
                <p>{job.type}</p>
                <div className="features">
                  {job.features.map((feature, idx) => (
                      <span key={idx} className="feature">
                  {feature}
                </span>
                  ))}
                </div>
              </div>
          ))}
        </div>
      </div>
  );
}

export default App;
